import { Component } from '@angular/core';
import { DeviceDetectorService } from 'src/app/device-detector.service';

@Component({
  selector: 'app-answers-false',
  templateUrl: './answers-false.component.html',
  styleUrls: ['./answers-false.component.scss']
})
export class AnswersFalseComponent {

  isMobile: boolean;

  constructor(private deviceDetector: DeviceDetectorService) { }

  ngOnInit() {
    window.scrollTo(0, 0);

    this.isMobile = this.deviceDetector.isMobile();
  }

}
